import React from 'react';
import TodoItem from './TodoItem';

const styles = {
    ul: {
        listStyle: 'none'
    },
};

export default function TodoList(props) {
    return (
        <ul style={styles.ul}>
            {props.todo.map(todo => {
                return <TodoItem />
            }) }
        </ul>
    );
};
